import React from 'react';
import Rating from 'react-rating';

const ImgCard = ({ className, imgPath }) => {
  return (
    <div className={className}>
      <img src={imgPath} height="50%" width="100%" alt=""/>
      <div className="Details">
        <div className="PersonalDetail">
          Jhon Smith
          {/* <img src="/images/PreVerify.svg" className="PreVerify" height="20%" width="20%"  alt=""/> */}
        </div>
        <div>
          <Rating
            // readonly={}
            // onClick={}
            // initialRating={}
            emptySymbol={<img src="/images/empty-star.svg" alt='Empty Rating Star' />}
            fullSymbol={<img src={`${process.env.PUBLIC_URL}/svg/full-star.svg`} alt='Full Rating Star' />}
          />
        </div>
      </div>
    </div>
  );
};

export default ImgCard;
